import React from "react";
import { Map, GoogleApiWrapper, Marker, Polyline } from "google-maps-react";
const styles = {
  mapStyles: {
    width: "100%",
    height: "100%"
  }
};
const RealMap = props => {
  const { google, cars } = props;
  const markers = cars.map(car => {
    if (car.active) {
      return <Marker position={car.records[car.records.length - 1]} />;
    }
  });
  return (
    <Map
      google={google}
      zoom={15}
      style={styles.mapStyles}
      initialCenter={{lat:  15.196652155048742, lng: -70.22753810882568}}
    >
      {markers}
    </Map>
  );
};

export default GoogleApiWrapper({
  apiKey: "AIzaSyDqV0nn953l7QAY_1GKVKcQO6Md2YW2W1o"
})(RealMap);
